            break;
    }*/
    type.toLowerCase() === "black" ? <button className="flex gap-[1rem] items-center bg-[#000000] px-[1.2rem] py-[0.5rem] font-[archivo-medium] text-[#FFFFFF] text-[1rem] rounded-[2rem]" onClick={onClick}>{text}  <img src={getStart} alt="" /></button>: <button className="flex items-center bg-[#FFFFFF] px-[1rem] py-[0.5rem] font-[archivo-regular] text-[#000000] text-[1rem] rounded-[2rem]" onClick={onClick}>{text}</button>
}

